// 60秒后验证码过期处理
setInterval(() => {
  const timestamp = new Date().getTime();
  const keys = Object.keys(actualCaptcha);
  keys.forEach((key) => {
    if (timestamp - actualCaptcha[key].timestamp > 1000 * 60) {
      delete actualCaptcha[key];
    }
  });
}, 1000 * 60);

/* eslint-disable */
// 用于存储验证码
let actualCaptcha = {};

module.exports = {
  [`GET ${getCaptchaURL}`](req, res) {
    const cookie = req.headers.cookie;
    // 生成唯一标识;
    let key = uuidV4();
    if (cookie !== undefined) {
      key = cookie.split('=')[1];
    }
    let captchaIndex = Math.floor(Math.random() * 10);
    res.setHeader('Set-Cookie', 'JSESSIONID=' + key);
    actualCaptcha[key] = { captcha: captcha[captchaIndex], timestamp: new Date().getTime() };
    res.json({
      data: captcha[captchaIndex].data
    });
  },
  [`POST ${checkCaptchaURL}`](req, res) {
    const cookie = req.headers.cookie;
    const key = cookie.split('=')[1];
    if (actualCaptcha[key] && actualCaptcha[key].captcha && actualCaptcha[key].captcha.text === req.body.code) {
      res.json(true);
    } else {
      res.json(false);
    }
  },

  /**
   * 统一删除验证码
   * @param key sessionId
   * @param res
   */
  removeCaptcha(key, res) {
    if (typeof key === 'string') {
      delete actualCaptcha[key];
    } else {
      res && res.status(404);
    }
  },
  /**
   * 统一获取验证码
   * @param key sessionId
   * @param res
   * @returns 验证码对象
   */
  getCaptcha(key, res) {
    if (typeof key === 'string') {
      return actualCaptcha[key];
    } else {
      res && res.status(404);
    }
  }
};
